import Link from 'next/link'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { fas } from '@fortawesome/free-solid-svg-icons';

const Header = () => (
    <div>
        <Link href="/">
          <a><FontAwesomeIcon icon={['fas', 'fas fa-sign-in-alt']} /></a>

        </Link>
        <Link href="/login">
          <a>Login</a>
        </Link>
        <Link href="/user">
          <a>User</a>
        </Link>
        <style jsx>{`
            div {
                background: red;
            }
        `}</style>
    </div>
)

export default Header
